using System;
using System.Collections.Generic;
using System.Diagnostics;
using System.IO;
using System.Linq;
using System.Net;
using System.Threading.Tasks;
using Microsoft.AspNetCore.Authorization;
using Microsoft.AspNetCore.Mvc;
using Microsoft.Extensions.Logging;
using Microsoft.Extensions.Primitives;
using Newtonsoft.Json;
using PekiYaBen.API.Helpers;
using PekiYaBen.API.Models;
using PekiYaBen.API.Models.APIModels;
using PekiYaBen.API.Models.Entities;
using PekiYaBen.API.Services;

namespace PekiYaBen.API.Controllers
{
    [Authorize]
    [ApiController]
    [Route("[controller]")]
    public class AppUserController : ControllerBase
    {
        private IAppUserService _userService;
        public AppUserController(IAppUserService userService)
        {
            _userService = userService;
        }

        [AllowAnonymous]
        [HttpPost("authenticate")]
        public IActionResult Authenticate([FromBody]Authenticate model)
        {
            var user = _userService.Authenticate(model.Email, model.Password, model.IPAddress);
            APIResponse result = new APIResponse { Succeed = user.Succeed, Message = user.Message, Title = user.Title, Data = user.Data };

            var logger = new SimpleLogger();
            logger.Info("Request : Authenticate " + JsonConvert.SerializeObject(model));
            logger.Info("Response : Authenticate " + JsonConvert.SerializeObject(result));

            return Ok(result);
        }

        [AllowAnonymous]
        [HttpPost("socialauth")]
        public IActionResult SocialAuthenticate([FromBody]SocialAuthenticate model)
        {
            var user = _userService.SocialAuthenticate(model.Email, model.FullName, model.ProfilePhoto, model.SocialToken, model.SocialMedia, model.IPAddress);
            APIResponse result = new APIResponse { Succeed = user.Succeed, Message = user.Message, Title = user.Title, Data = user.Data };

            var logger = new SimpleLogger();
            logger.Info("Request : SocialAuthenticate " + JsonConvert.SerializeObject(model));
            logger.Info("Response : SocialAuthenticate " + JsonConvert.SerializeObject(result));

            return Ok(result);
        }

        [AllowAnonymous]
        [HttpPost("verifytoken")]
        public IActionResult VerifyToken([FromBody]VerifyToken model)
        {
            var response = _userService.VerifyToken(model.SocialToken, model.SocialMedia);

            var logger = new SimpleLogger();
            logger.Info("Request : VerifyToken " + model.SocialToken + "\r\n" + JsonConvert.SerializeObject(model));
            logger.Info("Response : VerifyToken " + model.SocialToken + "\r\n" + JsonConvert.SerializeObject(response));

            return Ok(response);
        }

        [AllowAnonymous]
        [HttpPost("verifypurchase")]
        public IActionResult VerifyPurchase([FromBody]VerifyPurchase model)
        {
            var response = _userService.VerifyPurchase(model.token, model.productId);

            return Ok(response);
        }

        [AllowAnonymous]
        [HttpPost("register")]
        public IActionResult Register(AppUser user)
        {
            var response = _userService.Register(user);

            var logger = new SimpleLogger();
            logger.Info("Request : Register " + JsonConvert.SerializeObject(user));
            logger.Info("Response : Register " + JsonConvert.SerializeObject(response));

            return Ok(response);
        }

        [AllowAnonymous]
        [HttpPost("resetpassword")]
        public IActionResult ResetPassword(ResetPassword reset)
        {
            var response = _userService.ResetPassword(reset.Email);

            var logger = new SimpleLogger();
            logger.Info("Request : ResetPassword " + JsonConvert.SerializeObject(reset));
            logger.Info("Response : ResetPassword " + JsonConvert.SerializeObject(response));

            return Ok(response);
        }

        [HttpPost("update")]
        public IActionResult Update(UdpateUser user)
        {
            var tokenValue = GetToken();
            var response = _userService.Update(user, tokenValue);

            var logger = new SimpleLogger();
            logger.Info("Request : Update " + tokenValue + JsonConvert.SerializeObject(user));
            logger.Info("Response : Update " + tokenValue + JsonConvert.SerializeObject(response));

            if (!String.IsNullOrEmpty(response.Message) && response.Message.Contains("401"))
                return StatusCode(401, "Unauthorized");

            return Ok(response);
        }

        [HttpPost("updatephoto")]
        public IActionResult UpdateProfilePhoto([FromForm]ProfilePhoto model)
        {
            var tokenValue = GetToken();
            byte[] image = new byte[0];
            if (model.Photo.Length > 0)
            {
                using (var ms = new MemoryStream())
                {
                    model.Photo.CopyTo(ms);
                    image = ms.ToArray();
                }
            }

            var response = _userService.UpdateProfilePhoto(tokenValue, image);

            var logger = new SimpleLogger();
            logger.Info("Request : UpdateProfilePhoto " + tokenValue + JsonConvert.SerializeObject(model));
            logger.Info("Response : UpdateProfilePhoto " + tokenValue + JsonConvert.SerializeObject(response));

            if (!String.IsNullOrEmpty(response.Message) && response.Message.Contains("401"))
                return StatusCode(401, "Unauthorized");

            return Ok(response);
        }

        [HttpPost("changepassword")]
        public IActionResult ChangePassword(ChangePassword pass)
        {
            var tokenValue = GetToken();
            var response = _userService.ChangePassword(tokenValue, pass);

            var logger = new SimpleLogger();
            logger.Info("Request : ChangePassword " + tokenValue + JsonConvert.SerializeObject(pass));
            logger.Info("Response : ChangePassword " + tokenValue + JsonConvert.SerializeObject(response));

            if (!String.IsNullOrEmpty(response.Message) && response.Message.Contains("401"))
                return StatusCode(401, "Unauthorized");

            return Ok(response);
        }

        [HttpPost("fcmregister")]
        public IActionResult FCMRegister(FCMTokenRegister request)
        {
            var tokenValue = GetToken();
            var response = _userService.FCMRegister(tokenValue, request.FCMToken);

            var logger = new SimpleLogger();
            logger.Info("Request : FCMRegister " + tokenValue + JsonConvert.SerializeObject(request));
            logger.Info("Response : FCMRegister " + tokenValue + JsonConvert.SerializeObject(response));

            return Ok(response);
        }

